import React from 'react';
import { Link } from 'react-router-dom';
import Particles from 'react-particles-js'; // Importa el componente Particles
import './RentsCRUD.css'; // Importa el archivo CSS para los estilos

function RentsCRUD() {
  return (
    <div className="rents-container">
         <Particles
        params={{
          particles: {
            number: {
              value: 50, // Número de partículas
              density: {
                enable: true,
                value_area: 800,
              },
            },
            shape: {
              type: 'circle', // Forma de las partículas
              stroke: {
                width: 0,
                color: '#000000',
              },
            },
            size: {
              value: 3, // Tamaño de las partículas
              random: true,
              anim: {
                enable: false,
                speed: 40,
                size_min: 0.1,
                sync: false,
              },
            },
            opacity: {
              value: 0.5, // Opacidad de las partículas
              random: true,
              anim: {
                enable: false,
                speed: 1,
                opacity_min: 0.1,
                sync: false,
              },
            },
            move: {
              enable: true,
              speed: 2, // Velocidad de movimiento de las partículas
              direction: 'none',
              random: true,
              straight: false,
              out_mode: 'out',
              bounce: false,
              attract: {
                enable: false,
                rotateX: 600,
                rotateY: 1200,
              },
            },
          },
          interactivity: {
            detect_on: 'canvas',
            events: {
              onhover: {
                enable: true,
                mode: 'repulse', // Efecto al pasar el mouse por encima
              },
              onclick: {
                enable: true,
                mode: 'push',
              },
              resize: true,
            },
            modes: {
              grab: {
                distance: 400,
                line_linked: {
                  opacity: 1,
                },
              },
              bubble: {
                distance: 400,
                size: 40,
                duration: 2,
                opacity: 8,
                speed: 3,
              },
              repulse: {
                distance: 100, // Distancia de repulsión al pasar el mouse
                duration: 0.4,
              },
              push: {
                particles_nb: 4,
              },
              remove: {
                particles_nb: 2,
              },
            },
          },
          retina_detect: true,
        }}
        style={{
          position: 'absolute',
          top: 0,
          left: 0,
          width: '100%',
          height: '100%',
        }}
      />
      <div className="banner-rents">ClonBuster: Rentas</div>
      <div className="buttons-column">
      <Link to="/create" className="action-rents-button">Crear</Link>
      <Link to="/read" className="action-rents-button">Leer</Link>
      <Link to="/update" className="action-rents-button">Actualizar</Link>
      <Link to="/delete" className="action-rents-button">Borrar</Link>
      <Link to="/" className="return-rents-button">Regresar</Link>
      </div>
    </div>
  );
}

export default RentsCRUD;
